void PortFCInit(void){volatile unsigned long delay;

  SYSCTL_RCGCGPIO_R |= 0x026;    //Activate Ports C,F
  delay = 0x30;
	delay = 0x40;
	delay = 0x59;
	//F4
	GPIO_PORTF_CR_R |= 0x10;
	GPIO_PORTF_AMSEL_R = 0x00;
	GPIO_PORTF_PCTL_R = 0x00;
	GPIO_PORTF_DIR_R &= 0xFFFFFFEF;
	GPIO_PORTF_DEN_R |= 0x10;
	GPIO_PORTF_PUR_R |= 0x10;
	//C
	GPIO_PORTC_LOCK_R = 0x4C4F4E4B;  // Buttons C4 and C5
	delay = 0x30;
	GPIO_PORTC_DIR_R &= 0xFFFFFFCF;
  GPIO_PORTC_PDR_R |= 0x10;
	GPIO_PORTC_DEN_R |= 0x30;
}

