// You can use this timer only if you learn how it works

void Delay100ms(uint32_t count){uint32_t volatile time;
  while(count>0){
    time = 727240;  // 0.1sec at 80 MHz
    while(time){
	  	time--;
    }
    count--;
  }
}

 uint32_t RandomX(uint32_t min, uint32_t max){
  return ((Random32()>>24)%(max-min+1))+min;  // returns min, min+1, min+2,..., or min+base
}
 

