void drawsprite(void){uint32_t i;
	
  // Draw BRICKS (erase right behind themselves)
  for(i = 0;i < 4; i++){
		if(Bricks[i].life == alive){
			ST7735_DrawBitmap(Bricks[i].x,Bricks[i].y,Bricks[i].image,Bricks[i].height,Bricks[i].width);
			if(Bricks[i].y < 159){
			  ST7735_DrawFastHLine(Bricks[i].x,Bricks[i].y+1,Bricks[i].height,0xB61A);
			}
		}
	}

	// Draw LIVING things
	for(i = 0;i < 5; i++){
		if(Living[i].life == alive){
	    ST7735_DrawBitmap(Living[i].x,Living[i].y,Living[i].image,Living[i].height,Living[i].width);
	  }
		if(Living[i].life == dead){
			ST7735_FillRect(Living[i].x,(Living[i].y-Living[i].width),Living[i].height,Living[i].width,0xB61A);
		}
	}
	
	// Draw NONLIVING things
	for(i = 0;i < 5; i++){
		if(i == 3 && JUMP == 0){ // Drawing over old sword position
			if(Nonliving[i].image == Sprites[first_sword].image){   // if Up, delete Dia
				ST7735_FillRect(Sprites[first_sword+1].x,(Sprites[first_sword+1].y-Sprites[first_sword+1].width),Sprites[first_sword+1].height,Sprites[first_sword+1].width,0xB61A);}
			if(Nonliving[i].image == Sprites[first_sword+1].image){ // if Dia, delete Right
				ST7735_FillRect(Sprites[first_sword+2].x,(Sprites[first_sword+2].y-Sprites[first_sword+2].width),Sprites[first_sword+2].height,Sprites[first_sword+2].width,0xB61A);}
		  if(Nonliving[i].image == Sprites[first_sword+2].image){ // if Right, delete Dia
				ST7735_FillRect(Sprites[first_sword+1].x,(Sprites[first_sword+1].y-Sprites[first_sword+1].width),Sprites[first_sword+1].height,Sprites[first_sword+1].width,0xB61A);}
		}
		
		
		if(Nonliving[i].life == alive){
			if(i == 4){ // Delete old sword if shield is up
				if(Nonliving[3].image == Sprites[first_sword].image){   // if Up, delete Up
					ST7735_FillRect(Sprites[first_sword].x,(Sprites[first_sword].y-Sprites[first_sword].width),Sprites[first_sword].height,Sprites[first_sword].width,0xB61A);}
				if(Nonliving[3].image == Sprites[first_sword+1].image){ // if Dia, delete Dia
					ST7735_FillRect(Sprites[first_sword+1].x,(Sprites[first_sword+1].y-Sprites[first_sword+1].width),Sprites[first_sword+1].height,Sprites[first_sword+1].width,0xB61A);}
				if(Nonliving[3].image == Sprites[first_sword+2].image){ // if Right, delete Right
					ST7735_FillRect(Sprites[first_sword+2].x,(Sprites[first_sword+2].y-Sprites[first_sword+2].width),Sprites[first_sword+2].height,Sprites[first_sword+2].width,0xB61A);}
			}
			ST7735_DrawBitmap(Nonliving[i].x,Nonliving[i].y,Nonliving[i].image,Nonliving[i].height,Nonliving[i].width);
		}
	}

}

//           ~~~~~~~~~~~~~~~~~~~~~~~~~
// ~~~~~~~~~~~~~~~UPDATE WORLD~~~~~~~~~~~~~~~~~~~~~~~~~
//           ~~~~~~~~~~~~~~~~~~~~~~~~~
void updateworld(void){uint32_t i;
	
		// ------------------LIVING THINGS------------------------
	for(i = 0; i < 5; i++){uint8_t wolf_frame;
		if(Living[i].life == alive){  
		  
			// ALTERNATING WOLVES
			if(Living[i].image == Sprites[wolf1_index].image){wolf_frame = 0;} // to alternate the wolf frames
			if(Living[i].image == Sprites[wolf2_index].image){wolf_frame = 1;}
			if(Living[i].image != Sprites[wolf2_index].image && Living[i].image != Sprites[wolf1_index].image){wolf_frame = 2;}
			
			switch(wolf_frame){  // changing the info to other wolf's info
				case 0 : Living[i].image = Sprites[wolf2_index].image; 
				         Living[i].height = Sprites[wolf2_index].height; 
				         Living[i].width = Sprites[wolf2_index].width; break;
				case 1 : Living[i].image = Sprites[wolf1_index].image; 
				         Living[i].height = Sprites[wolf1_index].height; 
				         Living[i].width = Sprites[wolf1_index].width; break;
				default: break;
			}
			// END ALTERNATING WOLVES
			
			// ALTERNATING LINK
			if(i == 4 && JUMP == 0){
			  if(Living[i].image == Sprites[0].image){Living[i].image = Sprites[1].image; break;}
			  if(Living[i].image == Sprites[1].image){Living[i].image = Sprites[0].image; break;}
		  }
			// END ALTERNATING LINK
			
			Living[i].y -= Living[i].displacement;  // Movement Left
			
			// Movement Up, jumping
			if(i == 4 && JUMP == 1 && jump_num < (jump_amount/2)){
				Living[i].x += Living[i].jumpplacement;
				jump_num++;
			}
			if(i == 4 && JUMP == 1 && jump_num >= (jump_amount/2)){
				jump_stall_num++;
				if(jump_stall_num > jump_stall){
					Living[i].x -= Living[i].jumpplacement;
					jump_num++;
					if(jump_num == jump_amount){jump_num = 0; jump_stall_num = 1;} // reset, if jump is over
				}
			}
			
			if(Living[i].y == 0){  // death to the obstacles
				Living[i].life = dead;
			}
			
		} // end of alive

  } // end of for
// ------------------------END OF LIVING THINGS-----------------------
	
// -------------------------NONLIVING THINGS (BRICKS TOO)------------------------
for(i = 0; i < 5;i++){
	if(Nonliving[i].life == alive){
	  
		Nonliving[i].y -= Nonliving[i].displacement;  // Movement
		// SWORD 
		if(i == 3 && JUMP == 1 && jump_nums < (jump_amount/2)){ // on the way up
				Nonliving[i].x += Nonliving[i].jumpplacement;
				jump_nums++;
			}
		if(i == 3 && JUMP == 1 && jump_nums >= (jump_amount/2)){ // going down
			jump_stall_nums++;
			if(jump_stall_nums > jump_stall){
				Nonliving[i].x -= Nonliving[i].jumpplacement;
				jump_nums++;
				if(jump_nums == jump_amount){jump_nums = 0; JUMP = 0; jump_stall_nums = 1;} // reset, if jump is over
			}
		}
		
    // (nothing to update with shield)
		
		if(Nonliving[i].y == 0){    // Death condition...
			Nonliving[i].life = dead;
		}
	} 
	
	if(Bricks[i].life == alive){
		Bricks[i].y -= Bricks[i].displacement; // Movement
		
		if(Bricks[i].y == 0){
			Bricks[i].life = dead;    // Death condition
			brickbuf[i] = 0;
		}
	}
} // end of for
// -----------------------END OF NONLIVING THINGS (BRICKS TOO)-----------------------
}

//           ~~~~~~~~~~~~~~~~~~~~~~~~~
// ~~~~~~~~~~~~~~~~~~~ACTIONS~~~~~~~~~~~~~~~~~~~~~~~~~
//           ~~~~~~~~~~~~~~~~~~~~~~~~~
void actions(void){ const uint32_t variable = 4;
	// check for a JUMP (PC4)
	if(GPIO_PORTC_DATA_R&0x10 && Nonliving[3].image == Sprites[first_sword].image && ~(GPIO_PORTC_DATA_R&0x20) && Nonliving[4].life == dead){
	  JUMP = 1;
		Living[4].jumpplacement = jump_inc;  // change link
		Nonliving[3].jumpplacement = jump_inc; // change sword
	}
	uint32_t test = variable + 1;
	// check for a BLOCK (PC5)
	if(GPIO_PORTC_DATA_R&0x20 && ~(GPIO_PORTC_DATA_R&0x10) && JUMP == 0){
		Nonliving[4].life = alive;
	}else{Nonliving[4].life = dead;}
	
	score += 100;
	
}

//           ~~~~~~~~~~~~~~~~~~~~~~~~~
// ~~~~~~~~~~~~~~~~~~~HURTBOXES~~~~~~~~~~~~~~~~~~~~~~~~~
//           ~~~~~~~~~~~~~~~~~~~~~~~~~
void hurtboxes(void){uint32_t i;
	
	// Link dies if!
	for(i = 0;i < 4; i++){ 
		if((Living[i].y - Living[i].width) < Living[4].y-2 && (Living[i].x + Living[i].height) > Living[4].x){
			Living[4].life = dead;
		}
	// Projectiles to be BLOCKed	
		if((Living[i].image == arrow || Living[i].image == fireball) && Nonliving[4].life == alive && (Nonliving[4].y) == (Living[i].y-Living[i].width)){
			Living[i].life = dead;
		}
	// Wolves to be STABBED
		if((Living[i].image == wolf1 || Living[i].image == wolf2) && Nonliving[3].image == swordRight && (Nonliving[3].y) >= (Living[i].y-Living[i].width)){
			Living[i].life = dead;
		}
	// Flying enemies
		if(Living[i].image == bird && Nonliving[3].image == swordDia && (Nonliving[3].y) >= (Living[i].y-Living[i].width)){
			Living[i].life = dead;
		}
	}
	
}


